import React, { useEffect } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/home/Home";
import Details from "./pages/details/Details";
import NotFound from "./pages/notfound/Notfound";
import Categories from "./pages/categories/Categories";
import { useDispatch } from "react-redux";
import { Fetchaction } from "./redux/actions/Fetchaction";
function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch()
  }, []);
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/politics" element={<Home />} />
        <Route path="/sports" element={<Home />} />
        <Route path="/arsenal" element={<Home />} />
        <Route path="/worklife" element={<Home />} />
        <Route path="/travel" element={<Home />} />
        <Route path="/future" element={<Home />} />
        <Route path="/culture" element={<Home />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
